import React, { useState } from 'react';
import "./index.css"


function App() {
    const [input, setInput] = useState("");
    const [addVal, setAddVal] = useState([]);
    const InputVal = (e) => {
        setInput(e.target.value)
    }
    const AddInput = () => {
        setAddVal((preVal)=>{
            return [...preVal,input]
        })
    }



    return (
        <>
            <div className='background'>
                <div className='card'>

                    <div className='cardTitle'>To Do List</div>

                    <input className='addContent' type="text" placeholder='Add a Item' onChange={InputVal} value={input} />
                    <button className='addBtn' onClick={AddInput}> + </button>

                    <ol className='list'>
                        <li>
                            {addVal}
                        </li>
                    </ol>

                </div>

            </div>
        </>
    );
}

export default App;
